        public static MultiPrecision<N12> Value(MultiPrecision<N12> x, bool complementary = false) {
            x = MultiPrecision<N12>.Abs(x);

            if (x <= 2) {
                MultiPrecision<N12> y;

                if (x <= 1d / 512) {
                    y = ApproxUtil<N12>.Pade(x, pade_0_rcp512);
                }
                else if (x <= 1d / 256) {
                    y = ApproxUtil<N12>.Pade(x - 1d / 512, pade_rcp512_rcp256);
                }
                else if (x <= 1d / 128) {
                    y = ApproxUtil<N12>.Pade(x - 1d / 256, pade_rcp256_rcp128);
                }
                else if (x <= 1d / 64) {
                    y = ApproxUtil<N12>.Pade(x - 1d / 128, pade_rcp128_rcp64);
                }
                else if (x <= 1d / 32) {
                    y = ApproxUtil<N12>.Pade(x - 1d / 64, pade_rcp64_rcp32);
                }
                else if (x <= 1d / 16) {
                    y = ApproxUtil<N12>.Pade(x - 1d / 32, pade_rcp32_rcp16);
                }
                else if (x <= 1d / 8) {
                    y = ApproxUtil<N12>.Pade(x - 1d / 16, pade_rcp16_rcp8);
                }
                else if (x <= 1d / 4) {
                    y = ApproxUtil<N12>.Pade(x - 1d / 8, pade_rcp8_rcp4);
                }
                else if (x <= 1d / 2) {
                    y = ApproxUtil<N12>.Pade(x - 1d / 4, pade_rcp4_rcp2);
                }
                else if (x <= 1) {
                    y = ApproxUtil<N12>.Pade(x - 1d / 2, pade_rcp2_1);
                }
                else {
                    y = ApproxUtil<N12>.Pade(x - 1, pade_1_2);
                }
                

                return complementary ? 0.5 - y : y;
            }
            else {
                MultiPrecision<N12> y;
            
                if (x <= 4) {
                    y = ApproxUtil<N12>.Pade(x - 2, pade_2_4);
                }
                else if (x <= 8) {
                    y = ApproxUtil<N12>.Pade(x - 4, pade_4_8);
                }
                else if (x <= 16) {
                    y = ApproxUtil<N12>.Pade(x - 8, pade_8_16);
                }
                else {
                    MultiPrecision<N12> v = MultiPrecision<N12>.Sqrt(x);

                    y = ApproxUtil<N12>.Pade(1 / v, pade_limit) / v;
                }

                return complementary ? y : 0.5 - y;
            }
        }
